def solve():
    n = int(input())
    s = input()

    ones = 0
    zeros = 0

    for c in s:
        if c == '1':
            ones += 1
        else:
            zeros += 1

    min_val = 1 << ones
    max_val = (1 << n) - (1 << zeros) + 1

    winning_numbers = [str(i) for i in range(min_val, max_val + 1)]

    print(' '.join(winning_numbers))


if __name__ == "__main__":
    t = 1
    while t > 0:
        solve()
